import React from 'react';
import CardItem from './CardItem';

class SearchCards extends React.Component{
    render(){
        return (
        this.props.cards.map( (card) => {
            return <SearchCardItem key={card.id} card={card} />
            })
        )

    }
}

export default SearchCards;
